// 2. 自己写，贪婪，AC！
func lemonadeChange(bills []int) bool {
	five, ten := 0, 0
	for _, v := range bills {
		fmt.Println(five)
		fmt.Println(ten)
		fmt.Println()
		if v == 5 {
			five++
		} else if v == 10 {
			if five > 0 {
				five--
				ten++
			} else {
				return false
			}
		} else if v == 20 {
			if five > 0 && ten > 0 {
				ten--
				five--
			} else if five > 2 {
				five -= 3
			} else  {
				return false
			}
		} else {
			return false
		}
	}
	return true
}


